import Modal from './components/modal.js'
import CoffeeSlider from './components/coffeeslider.js'
import React, { useState } from 'react'
import{ FaLocationArrow, FaTimes} from '@react-google-maps/api'
/* import ModalPopUp from './components/modalpopup.js' */




function App() {
  const {} = useJsApiLoader({
    googleMapsApiKey: ProcessingInstruction.env.REACT_APP_GOOGLE_MAPS_API_KEY,
  })

  const [show, setShow, isOpen] = useState(false);
  const [rangeValue, setRangeValue] = useState(10);
  const onChangeSlider = e => {
    setRangeValue(parseInt(e.target.value, 10));   
  }

  let openModal = e => {  
    if (rangeValue > 20) {
      openModal = setShow(true); 
      console.log(openModal);
    }
  }

  return (
    <div>
      <h1>Buzz Path</h1>
      <div>map goes here</div>
      <b>Start: </b>
      <input id="start" type="text"></input>
      <b>End: </b>
      <input id="end" type="text"></input>
      <div>
        <CoffeeSlider
          min={0}
          max={100}
          step={1}
          /* defaultValue = {1} */
          value={rangeValue}
          onChangeValue={onChangeSlider}
        />
      </div>

      <div className="modal-button">
        <button onClick={() => setShow(true)}>Coffee Addiction?</button>
        <Modal onClose={() => setShow(false)} show={show} />
      </div>
    </div>
  );
}

